function productPageScript(){
  /* Meta_object_tabs_list_slider */
  new Swiper('.Meta_object_tabs_list_slider', {
    loop: false,
    grabCursor: false,
    spaceBetween: 8,
    slidesPerGroup: 1,
    slidesPerView: "auto",
    watchSlidesProgress: true,
    draggable:!0,
    autoHeight:!1,
    watchOverflow:!0,
    threshold:10,
    mousewheel:{
      forceToAxis:!0
    },
    observer: true,
    observeParents: true,
    navigation: {
      nextEl: ".swiper-button-next",
      prevEl: ".swiper-button-prev",
    }
  })

  /* Logo_list_slider_slider */
  /*new Swiper('.Logo_list_slider_slider', {
    loop: false,
    grabCursor: false,
    spaceBetween: 12,
    slidesPerGroup: 1,
    slidesPerView: "auto",
    watchSlidesProgress: true,
    draggable:!0,
    autoHeight:!1,
    watchOverflow:!0,
    threshold:10,
    mousewheel:{
      forceToAxis:!0
    },
    observer: true,
    observeParents: true,
    breakpoints: {
      0: {
        spaceBetween: 12,
      },
      750: {
        spaceBetween: 12,
      },
      990: {
      },
      1200: {
      },
      1440: {
      }
    }
  })*/
    
  /* product_desktop_slider_new */
  var slider_width = $(document).width();
  if(slider_width > 0)
  {
    new Swiper('.product_desktop_slider_new', {
      loop: true,
      grabCursor: false,
      spaceBetween: 20,
      slidesPerGroup: 1,
      slidesPerView: "auto",
      watchSlidesProgress: true,
      draggable:!0,
      autoHeight:!1,
      watchOverflow:!0,
      threshold:10,
      mousewheel:{
        forceToAxis:!0
      },
      pagination: {
        el: ".swiper-pagination",
        clickable: true,
      },
      navigation: {
        nextEl: ".swiper-button-next",
        prevEl: ".swiper-button-prev",
      },
      breakpoints: {
        0: {
          spaceBetween: 15,
          slidesPerView:"1.1",
          loop: false,
        },
        750: {
          spaceBetween: 20,
          slidesPerView:"auto",
          loop: true,
        }
      }
    })
  }
  if(slider_width > 749)
  {
    var $el = $('.Product_template_main_new');
    if ($el.length > 0) {
      var Header_announcement_bar_main_new  = $(".Header_announcement_slide_main_new").outerHeight(true);
      var Header_main_new = $(".header-wrapper").outerHeight(true);
      var stickyHeaderTop = Header_announcement_bar_main_new + Header_main_new;
      
      //console.log(stickyHeaderTop);
      // passing "true" will also include the top and bottom margin
      $(window).scroll(function () {
          if ($(window).scrollTop() > stickyHeaderTop) {
              if ($('body').hasClass("product_slider_fixed") == false) {
                  $('body').addClass('product_slider_fixed');
              }
          } else {
              $('body').removeClass('product_slider_fixed');
          }
      });
    }
  }
    
  if($(".Product_template_main_new").length > 0)
  {
    var stickyHeaderTopSticky = $(".Product_template_main_new").offset().top +  $(".Product_template_main_new").outerHeight(true);
    $(window).scroll(function(){
    
      if( $(window).scrollTop() > stickyHeaderTopSticky ) {
          if($('body').hasClass("scrolled-past-header-body") == false)
          {
              $('body').addClass('scrolled-past-header-body');
              $('body').addClass('display_header_new');
              /*setTimeout(function() {
                $('body').addClass('display_header_new');
              },100)*/
          }
      } else {
          $('body').removeClass('scrolled-past-header-body');
          $('body').removeClass('display_header_new');
          /*$('body').addClass('hide_header_new');
          setTimeout(function() {
                $('body').removeClass('scrolled-past-header-body');
                $('body').removeClass('display_header_new');
                $('body').removeClass('hide_header_new');
          },100)*/
      }
    });
  }

  $(".people_video_new").click(function(){
    if($(this).hasClass("active") == false)
    {
      $(this).parents(".Meta_real_life_items_slider").find('video').trigger('pause');
      $(this).parents(".Meta_real_life_items_slider").find("svg").css("display","block");
      $(this).parents(".Meta_real_life_items_slider").find(".people_video_new").removeClass("active");
      $(this).addClass("active");
      var URL = $(this).find('video').attr("video_url");
      if($(this).find('video').attr("src") == null)
      {
        $(this).find('video').attr("src",URL);
      }
      $(this).find('video').trigger('play');
      $(this).find("svg").css("display","none");
    }
    else
    {
      $(this).removeClass("active");
      $(this).find('video').trigger('pause');
      $(this).find("svg").css("display","block");
    }
  })

  $(".sticky_stitch_product_list_dropdown_new").click(function () {
    $(this).toggleClass("active");
    $(this).next(".sticky_stitch_product_list_dropdown_details_open_new").fadeToggle();
  })

  $(document).mouseup(function(e) 
  {
      var container = $(".sticky_stitch_product_list_dropdown_new");
  
      // if the target of the click isn't the container nor a descendant of the container
      if (!container.is(e.target) && container.has(e.target).length === 0) 
      {
        $(".sticky_stitch_product_list_dropdown_new").removeClass("active");
        $(".sticky_stitch_product_list_dropdown_details_open_new").fadeOut();
      }
  });

  /* scroll */
  var $el_list = $('.sticky_addtocart_middle_new a');
  if ($el_list.length > 0) {
    $(document).ready(function() {
      var targetHash_1 = location.hash.substr(1);
      if($("#" + targetHash_1).length > 0)
      {
        var divHeight = $(".sticky-addtocart-button").outerHeight(true);
        var offsetTop = targetHash_1 === "#" ? 0 : $("#"+targetHash_1).offset().top - divHeight;
        //console.log("targetHash window:"+offsetTop);  
        
        $('html, body').stop().animate({
          scrollTop: offsetTop 
        },700);
      }
    })
  }
  
  // Cache selectors
  var lastId,
  topMenu = $(".sticky_addtocart_middle_new"),
  topMenuHeight = $(".sticky-addtocart-button").outerHeight(true),
  // All list items
  menuItems = topMenu.find("a"),
  // Anchors corresponding to menu items
  scrollItems = menuItems.map(function () {
    var item = $(this).attr("href");
    if (item != '#') {return $(item);}
  });

  // Bind click handler to menu items
  // so we can get a fancy scroll animation
  
  menuItems.click(function (e) {
    $(".sticky_addtocart_middle_new a").removeClass("active");
    $(this).addClass("active");
    var divHeight = $(".sticky-addtocart-button").outerHeight(true);
    var href = $(this).attr("href"),
    targetHash = this.hash,
    offsetTop = href === "#" ? 0 : $(href).offset().top - divHeight;
    console.log("targetHash1:"+offsetTop);
    $('html, body').stop().animate({
      scrollTop: offsetTop 
    },700);
    window.location.hash = targetHash;
    e.preventDefault();
  });

  // Bind to scroll
  $(window).scroll(function () {
    var $el_list = $('.sticky_addtocart_middle_new a');
    
      // Get container scroll position
      var fromTop = $(this).scrollTop() + (topMenuHeight * 2);
  
      // Get id of current scroll item
      var cur = scrollItems.map(function () {
        if ($(this).offset().top < fromTop)
          //console.log(this)
          return this;
      });
      // Get the id of the current element
      cur = cur[cur.length - 1];
      var id = cur && cur.length ? cur[0].id : "";
  
      if (lastId !== id) {
        lastId = id;
        // Set/remove active class
        menuItems.filter(".sticky_addtocart_middle_new a").removeClass("active").
        end().filter("[href='#" + id + "']").addClass("active");
      }
    
  });
  /* scroll */

}
productPageScript()

