var youtubeIframe = document.getElementById('youtubeVimeoIframe');
console.log("YouTube or Vimeo video:", youtubeIframe);

// Check if the iframe is a YouTube or Vimeo video
var isYouTubeVideo = youtubeIframe !== null && youtubeIframe.src.includes("youtube.com");
var isVimeoVideo = youtubeIframe !== null && youtubeIframe.src.includes("vimeo.com");

// Add enablejsapi=1 to YouTube iframe if it's not already there
if (isYouTubeVideo) {
    let src = youtubeIframe.src;
    if (!src.includes("enablejsapi=1")) {
        youtubeIframe.src += (src.includes("?") ? "&" : "?") + "enablejsapi=1";
    }
}

// Vimeo API setup: Vimeo API requires loading of the iframe player
var vimeoPlayer;
if (isVimeoVideo) {
    var iframe = document.querySelector('iframe');
    vimeoPlayer = new Vimeo.Player(iframe);  // Initialize the Vimeo player using Vimeo's API
}

// Play button event
$(".Video_popup_section .play_button").on("click", function(){
  $("body").addClass("overflow_hidden");
  $(".Video_popup_setion_popup_video_main").show();
  $("main").css("z-index", "10");

  if ($(".Video_popup_setion_popup_video").hasClass("shopify_video")) {
    $(".Video_popup_setion_popup_video video").get(0).play();
  }

  // Handle YouTube video autoplay (if it exists)
  if (isYouTubeVideo) {
    youtubeIframe.contentWindow.postMessage('{"event":"command","func":"playVideo","args":""}', '*');
  }

  // Handle Vimeo video autoplay (if it exists)
  if (isVimeoVideo) {
    vimeoPlayer.play().catch(function(error) {
        console.error("Vimeo play error:", error);
    });
  }
});

// Close button event
$(".Video_popup_setion_popup_video_main .button--close").on("click", function(){
  $("body").removeClass("overflow_hidden");
  $(".Video_popup_setion_popup_video_main").hide();
   $("main").css("z-index", "2");

  if ($(".Video_popup_setion_popup_video").hasClass("shopify_video")) {
    $(".Video_popup_setion_popup_video video").get(0).pause();
  }

  // Handle YouTube video stop (pause or stop)
  if (isYouTubeVideo) {
    youtubeIframe.contentWindow.postMessage('{"event":"command","func":"pauseVideo","args":""}', '*');
  }

  // Handle Vimeo video stop (pause)
  if (isVimeoVideo) {
    vimeoPlayer.pause().catch(function(error) {
        console.error("Vimeo pause error:", error);
    });
  }
});

